import React from 'react';
import PropTypes from 'prop-types';
import clsx from 'clsx';
import { withStyles } from '@material-ui/styles';
import {
    Card,
    CardHeader,
    CardContent,
    CardActions,
    Typography,
    Grid,
    Divider,
    Avatar
} from '@material-ui/core';
import { StatusBullet } from 'components';
import { URI } from './../../../../constants/types';
import styles from './styles';

const statusColors = {
    true: 'success',
    false: 'danger'
};
const PresencesCard = props => {
    const { className, classes } = props;
    return (
        <Card className={clsx(classes.root, className)}>
            <Grid container justify="space-between">
                <Grid item>
                    <CardHeader
                        avatar={
                            <Avatar
                                src={
                                    'http://www.gravatar.com/avatar/f8aef9003205946523250a062b54bbb6?s=200&r=pg&d=retro'
                                }
                            />
                        }
                        title={
                            <Typography variant="h5">
                                He thong thong tin
                            </Typography>
                        }
                        subheader={
                            <Typography variant="body2">by Shi Fen</Typography>
                        }
                    />
                </Grid>
                <Grid item>
                    <Typography variant="h5" color="textPrimary">
                        12
                    </Typography>
                    <Typography variant="body1" color="textSecondary">
                        Chua biet
                    </Typography>
                </Grid>
                <Grid item>
                    <Typography variant="h5" color="textPrimary">
                        12
                    </Typography>
                    <Typography variant="body1" color="textSecondary">
                        Total Member
                    </Typography>
                </Grid>
                <Grid item>
                    <Typography variant="h5" color="textPrimary">
                        12 Noverber 2019
                    </Typography>
                    <Typography variant="body1" color="textSecondary">
                        Time Started
                    </Typography>
                </Grid>
                <Grid item>
                    <Typography variant="h5" color="textPrimary">
                        12 Noverber 2019
                    </Typography>
                    <Typography variant="body1" color="textSecondary">
                        Time End
                    </Typography>
                </Grid>
                <Grid item>
                    <Typography variant="h5" color="textPrimary">
                        Active
                    </Typography>
                    <Typography variant="body1" color="textSecondary">
                        Class status
                    </Typography>
                </Grid>
                <Grid item>
                    <Typography variant="button" color="textPrimary">
                        View
                    </Typography>
                </Grid>
            </Grid>
        </Card>
    );
};
export default withStyles(styles)(PresencesCard);
